import {Link} from 'react-router-dom';

const ProductDetail = (props) => {
  return (
    <>
    <Link className="modal__text" to="/">
            Volver al inicio
            <i className="modal__close icon fas fa-times"></i>
          </Link>
      <section className="modal__card">
        <img
          className="modal__card-img"
          src={props.products.image}
          alt={`Foto de ${props.products.name}`}
          title={`Foto de ${props.products.name}`}
        />
        <p className="modal__card-ranking">{props.products.sales_ranking}</p>
        <p className="modal__card-id">{props.products.id}</p>
        <h4 className="modal__card-name">{props.products.name}</h4>
        <p className="modal__card-price">{props.products.price}â‚¬</p>
        <p className="modal__card-size">{props.products.size_stockXS}</p>
        <p className="modal__card-size">{props.products.size_stockS}</p>
        <p className="modal__card-size">{props.products.size_stockM}</p>
        <p className="modal__card-size">{props.products.size_stockL}</p>
        <p className="modal__card-size">{props.products.size_stockXL}</p>
        <p className="modal__card-size">{props.products.size_stockXXL}</p>
        <p className="modal__card-rate"> {props.products.stockout_rate}%</p>
        <p className="modal__card-coverage">
          Cobertura almacen {props.products.wh_coverage}
        </p>
      </section>
    </>
  );
};
export default ProductDetail;
